import os
import csv
import re
from datetime import date

class DataProcessor:
    def process_deletions(self, deletion_date):
        records = self.get_records(deletion_date)
        for record in records:
            self.delete_record(record)

    def update_sql_codes(self, sql_code):
        with open('sql_codes.txt', 'w') as file:
            file.write(sql_code)

    def add_derivation_logic(self, logic):
        with open('derivation_logic.txt', 'a') as file:
            file.write(logic + '\n')

    def derive_funding_agency_codes(self, data):
        agency_codes = {}
        for record in data:
            agency_code = record['agency_code']
            if agency_code not in agency_codes:
                agency_codes[agency_code] = []
            agency_codes[agency_code].append(record)
        return agency_codes

    def map_federal_action_obligations(self, data):
        obligations = {}
        for record in data:
            obligation = record['obligation']
            if obligation not in obligations:
                obligations[obligation] = []
            obligations[obligation].append(record)
        return obligations

    def validate_ppopzip(self, zip_code):
        pattern = r'^\d{5}(?:-\d{4})?$'
        if re.match(pattern, zip_code):
            return True
        return False


