class FABSUser:
    def update_fabs_submissions(self, submission):
        with open('fabs_submissions.txt', 'a') as file:
            file.write(submission + '\n')

    def add_gtas_window_data(self, data):
        with open('gtas_window_data.txt', 'a') as file:
            file.write(data + '\n')

    def update_fabs_sample_file(self, sample_file):
        with open('fabs_sample_file.txt', 'w') as file:
