    def deactivate_publish_button(self):
        with open('publish_button_status.txt', 'w') as file:
            file.write('disabled')


class FABSLoader:
    def derive_fields(self, data):
        derived_fields = {}
        for record in data:
            derived_fields[record['id']] = record['derived_field']
        return derived_fields

    def include_frec_derivations(self, data):
        frec_derivations = {}
        for record in data:
            frec_derivations[record['id']] = record['frec_derived_field']
        return frec_derivations


class BrokerUser:
